SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
BEGIN;
CREATE TABLE "giaothong" (gid serial PRIMARY KEY,
"ma_duong" varchar(10),
"ten_duong" varchar(30),
"loai_duong" varchar(15),
"mot_chieu" int4);
SELECT AddGeometryColumn('','giaothong','the_geom','4326','MULTILINESTRING',2);
CREATE INDEX "giaothong_the_geom_gist" ON "giaothong" using gist ("the_geom" gist_geometry_ops);
COMMIT;
